const hydrateBrandData = (brandMeta, seriesList = []) => {
  const items = [];
  const seriesIndex = [];
  seriesList.forEach((series) => {
    if (!series?.items?.length) return;
    // Preserve any palette defined at the series level so UI can use it
    seriesIndex.push({ id: series.id, name: series.name, palette: series.palette || null });
    // Ensure secrets appear last within the series while preserving relative order
    const sortedItems = Array.from(series.items).sort((a, b) => {
      const aIsSecret = (a.rarity || '').toLowerCase() === 'secret' ? 1 : 0;
      const bIsSecret = (b.rarity || '').toLowerCase() === 'secret' ? 1 : 0;
      return aIsSecret - bIsSecret; // non-secrets (0) come before secrets (1)
    });
    sortedItems.forEach((item) => {
      items.push({
        ...item,
        seriesId: series.id,
        seriesName: series.name,
        // If the item doesn't have its own palette, inherit the series palette
        palette: Array.isArray(item.palette) && item.palette.length ? item.palette : (Array.isArray(series.palette) ? series.palette : undefined)
      });
    });
  });
  return { items, seriesIndex };
};

